import { Routes, Route, BrowserRouter } from "react-router-dom";
import Navbar from "./pages/shared/navbar/Navbar";
import Splash from "./pages/splash/Splash";
import SplashLinks from "./pages/shared/navbar/links/splash/splash";
import { QuestionnaireSelection } from "./pages/questionnaire-dashboard/questionnaire-selection/QuestionnaireSelection";
import { Questionnaire } from "./pages/questionnaire-dashboard/questionnaire/Questionnaire";
import { QuestionnaireContextProvider } from "./pages/questionnaire-dashboard/questionnaire-context-provider/QuestionnaireContextProvider";
import { UserContextProvider } from "./types/UserContextProvider";

export default function Main() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Navbar
              childComponent={
                <UserContextProvider>
                  <Splash />
                </UserContextProvider>
              }
              links={<SplashLinks />}
              homeUrl={"/"}
            />
          }
        />

        <Route
          path="/questionnaire-home"
          element={
            <QuestionnaireContextProvider>
              <QuestionnaireSelection />
            </QuestionnaireContextProvider>
          }
        />
        <Route
          path="/questionnaire/:id"
          element={
            <UserContextProvider>
              <QuestionnaireContextProvider>
                <Questionnaire />
              </QuestionnaireContextProvider>
            </UserContextProvider>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}
